---------------------------------------------\\r\\n\\/\\/ | author: likeadminTeam\\r\\n\\/\\/ +----------------------------------------------------------------------\\r\\n\\r\\nnamespace app\\\\adminapi\\\\validate;\\r\\n\\r\\n\\r\\nuse app\\\\common\\\\validate\\\\BaseValidate;\\r\\n\\r\\n\\r\\n\\/**\\r\\n * Users验证器\\r\\n * Class UsersValidate\\r\\n * @package app\\\\adminapi\\\\validate\\r\\n *\\/\\r\\nclass UsersValidate extends BaseValidate\\r\\n{\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 设置搜索条件\\r\\n     * @return \\\\string[][]\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    protected $rule = [\\r\\n        \'id\' => \'require\',\\r\\n        \'amount1\' => \'require\',\\r\\n        \'amount2\' => \'require\',\\r\\n    ];\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 添加场景\\r\\n     * @return UsersValidate\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public function sceneAdd()\\r\\n    {\\r\\n        return $this->remove(\'id\', true);\\r\\n    }\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 删除场景\\r\\n     * @return UsersValidate\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public function sceneDelete()\\r\\n    {\\r\\n        return $this->only([\'id\']);\\r\\n    }\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 详情场景\\r\\n     * @return UsersValidate\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public function sceneDetail()\\r\\n    {\\r\\n        return $this->only([\'id\']);\\r\\n    }\\r\\n\\r\\n}\"},{\"name\":\"UsersLogic.php\",\"type\":\"php\",\"content\":\"<?php\\r\\n\\/\\/ +----------------------------------------------------------------------\\r\\n\\/\\/ | likeadmin快速开发前后端分离管理后台（PHP版）\\r\\n\\/\\/ +----------------------------------------------------------------------\\r\\n\\/\\/ | 欢迎阅读学习系统程序代码，建议反馈是我们前进的动力\\r\\n\\/\\/ | 开源版本可自由商用，可去除界面版权logo\\r\\n\\/\\/ | gitee下载：https:\\/\\/gitee.com\\/likeshop_gitee\\/likeadmin\\r\\n\\/\\/ | github下载：https:\\/\\/github.com\\/likeshop-github\\/likeadmin\\r\\n\\/\\/ | 访问官网：https:\\/\\/www.likeadmin.cn\\r\\n\\/\\/ | likeadmin团队 版权所有 拥有最终解释权\\r\\n\\/\\/ +----------------------------------------------------------------------\\r\\n\\/\\/ | author: likeadminTeam\\r\\n\\/\\/ +----------------------------------------------------------------------\\r\\n\\r\\nnamespace app\\\\adminapi\\\\logic;\\r\\n\\r\\n\\r\\nuse app\\\\common\\\\model\\\\Users;\\r\\nuse app\\\\common\\\\logic\\\\BaseLogic;\\r\\nuse think\\\\facade\\\\Db;\\r\\n\\r\\n\\r\\n\\/**\\r\\n * Users逻辑\\r\\n * Class UsersLogic\\r\\n * @package app\\\\adminapi\\\\logic\\r\\n *\\/\\r\\nclass UsersLogic extends BaseLogic\\r\\n{\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 添加\\r\\n     * @param array $params\\r\\n     * @return bool\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public static function add(array $params): bool\\r\\n    {\\r\\n        Db::startTrans();\\r\\n        try {\\r\\n            Users::create([\\r\\n\\r\\n            ]);\\r\\n\\r\\n            Db::commit();\\r\\n            return true;\\r\\n        } catch (\\\\Exception $e) {\\r\\n            Db::rollback();\\r\\n            self::setError($e->getMessage());\\r\\n            return false;\\r\\n        }\\r\\n    }\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 编辑\\r\\n     * @param array $params\\r\\n     * @return bool\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public static function edit(array $params): bool\\r\\n    {\\r\\n        Db::startTrans();\\r\\n        try {\\r\\n            Users::update([\\r\\n                \'id\' => $params[\'id\'],\\r\\n                \'amount1\' => $params[\'amount1\'],\\r\\n                \'amount2\' => $params[\'amount2\'],\\r\\n            ]);\\r\\n\\r\\n            Db::commit();\\r\\n            return true;\\r\\n        } catch (\\\\Exception $e) {\\r\\n            Db::rollback();\\r\\n            self::setError($e->getMessage());\\r\\n            return false;\\r\\n        }\\r\\n    }\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 删除\\r\\n     * @param array $params\\r\\n     * @return bool\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public static function delete(array $params): bool\\r\\n    {\\r\\n        return Users::destroy($params[\'id\']);\\r\\n    }\\r\\n\\r\\n\\r\\n    \\/**\\r\\n     * @notes 获取详情\\r\\n     * @param $params\\r\\n     * @return array\\r\\n     * @author likeadmin\\r\\n     * @date 2022\\/08\\/11 10:16\\r\\n     *\\/\\r\\n    public static function detail($params): array\\r\\n    {\\r\\n        return Users::findOrEmpty($params[\'id\'])->toArray();\\r\\n    }\\r\\n}\"},{\"name\":\"users.ts\",\"type\":\"ts\",\"content\":\"import request from \'@\\/utils\\/request\'\\r\\n\\r\\n\\/\\/ 用户表列表\\r\\nexport function apiUsersLists(params: any) {\\r\\n    return request.get({ url: \'\\/users\\/lists\', params })\\r\\n}\\r\\n\\r\\n\\/\\/ 添加用户表\\r\\nexport function apiUsersAdd(params: any) {\\r\\n    return request.post({ url: \'\\/users\\/add\', params })\\r\\n}\\r\\n\\r\\n\\/\\/ 编辑用户表\\r\\nexport function apiUsersEdit(params: any) {\\r\\n    return request.post({ url: \'\\/users\\/edit\', params })\\r\\n}\\r\\n\\r\\n\\/\\/ 删除用户表\\r\\nexport function apiUsersDelete(params: any) {\\r\\n    return request.post({ url: \'\\/users\\/delete\', params })\\r\\n}\\r\\n\"},{\"name\":\"index.vue\",\"type\":\"vue\",\"content\":\"<template>\\r\\n    <div>\\r\\n        <el-card class=\\\"!border-none mb-4\\\" shadow=\\\"never\\\">\\r\\n            <el-form\\r\\n                class=\\\"mb-[-16px]\\\"\\r\\n                :model=\\\"queryParams\\\"\\r\\n                inline\\r\\n            >\\r\\n                <el-form-item label=\\\"钱包地址\\\" prop=\\\"address\\\">\\r\\n                    <el-input class=\\\"w-56\\\" v-model=\\\"queryParams.address\\\" clearable placeholder=\\\"请输入钱包地址\\\" \\/>\\r\\n                <\\/el-form-item>\\r\\n                <el-form-item label=\\\"上级ID\\\" prop=\\\"fid\\\">\\r\\n                    <el-input class=\\\"w-56\\\" v-model=\\\"queryParams.fid\\\" clearable placeholder=\\\"请输入上级ID\\\" \\/>\\r\\n                <\\/el-form-item>\\r\\r\\n                <el-form-item>\\r\\n                    <el-button type=\\\"primary\\\" @click=\\\"resetPage\\\">查询<\\/el-button>\\r\\n                    <el-button @click=\\\"resetParams\\\">重置<\\/el-button>\\r\\n                <\\/el-form-item>\\r\\n            <\\/el-form>\\r\\n        <\\/el-card>\\r\\n        <el-card class=\\\"!border-none\\\" v-loading=\\\"pager.loading\\\" shadow=\\\"never\\\">\\r\\n            <el-button v-perms=\\\"[\'users\\/add\']\\\" type=\\\"primary\\\" @click=\\\"handleAdd\\\">\\r\\n                <template #icon>\\r\\n                    <icon name=\\\"el-icon-Plus\\\" \\/>\\r\\n                <\\/template>\\r\\n                新增\\r\\n            <\\/el-button>\\r\\n            <el-button\\r\\n                v-perms=\\\"[\'users\\/delete\']\\\"\\r\\n                :disabled=\\\"!selectData.length\\\"\\r\\n                @click=\\\"handleDelete(selectData)\\\"\\r\\n            >\\r\\n                删除\\r\\n            <\\/el-button>\\r\\n            <div class=\\\"mt-4\\\">\\r\\n                <el-table :data=\\\"pager.lists\\\" @selection-change=\\\"handleSelectionChange\\\">\\r\\n                    <el-table-column type=\\\"selection\\\" width=\\\"55\\\" \\/>\\r\\n                    <el-table-column label=\\\"ID\\\" prop=\\\"id\\\" \\/>\\r\\n                    <el-table-column label=\\\"钱包地址\\\" prop=\\\"address\\\" \\/>\\r\\n                    <el-table-column label=\\\"上级ID\\\" prop=\\\"fid\\\" \\/>\\r\\n                    <el-table-column label=\\\"链上BNB快照\\\" prop=\\\"amount1\\\" \\/>\\r\\n                    <el-table-column label=\\\"BNB分红\\\" prop=\\\"amount2\\\" \\/>\\r\\n                    <el-table-column label=\\\"分红次数\\\" prop=\\\"count\\\" \\/>\\r\\n                    <el-table-column label=\\\"创建时间\\\" prop=\\\"create_time\\\" \\/>\\r\\r\\n                    <el-table-column label=\\\"操作\\\" width=\\\"120\\\" fixed=\\\"right\\\">\\r\\n                        <template #default=\\\"{ row }\\\">\\r\\n                             <el-button\\r\\n                                v-perms=\\\"[\'users\\/edit\']\\\"\\r\\n                                type=\\\"primary\\\"\\r\\n                                link\\r\\n                                @click=\\\"handleEdit(row)\\\"\\r\\n                            >\\r\\n                                编辑\\r\\n                            <\\/el-button>\\r\\n                            <el-button\\r\\n                                v-perms=\\\"[\'users\\/delete\']\\\"\\r\\n                                type=\\\"danger\\\"\\r\\n                                link\\r\\n                                @click=\\\"handleDelete(row.id)\\\"\\r\\n                            >\\r\\n                                删除\\r\\n                            <\\/el-button>\\r\\n                        <\\/template>\\r\\n                    <\\/el-table-column>\\r\\n                <\\/el-table>\\r\\n            <\\/div>\\r\\n            <div class=\\\"flex mt-4 justify-end\\\">\\r\\n                <pagination v-model=\\\"pager\\\" @change=\\\"getLists\\\" \\/>\\r\\n            <\\/div>\\r\\n        <\\/el-card>\\r\\n        <edit-popup v-if=\\\"showEdit\\\" ref=\\\"editRef\\\" @success=\\\"getLists\\\" @close=\\\"showEdit = false\\\" \\/>\\r\\n    <\\/div>\\r\\n<\\/template>\\r\\n\\r\\n<script lang=\\\"ts\\\" setup>\\r\\nimport { usePaging } from \'@\\/hooks\\/usePaging\'\\r\\nimport { dictDataLists } from \'@\\/api\\/setting\\/dict\'\\r\\nimport { apiUsersLists, apiUsersDelete } from \'@\\/api\\/users\'\\r\\nimport { timeFormat } from \'@\\/utils\\/util\'\\r\\nimport feedback from \'@\\/utils\\/feedback\'\\r\\nimport EditPopup from \'.\\/edit.vue\'\\r\\n\\r\\nconst editRef = shallowRef<InstanceType<typeof EditPopup>>()\\r\\n\\/\\/ 是否显示编辑框\\r\\nconst showEdit = ref(false)\\r\\n\\r\\n\\r\\n\\/\\/ 查询条件\\r\\nconst queryParams = reactive({\\r\\n    address: \'\',\\r\\n    fid: \'\',\\r\\n})\\r\\n\\r\\n\\/\\/ 选中数据\\r\\nconst selectData = ref<any[]>([])\\r\\n\\r\\n\\/\\/ 表格选择后回调事件\\r\\nconst handleSelectionChange = (val: any[]) => {\\r\\n    selectData.value = val.map(({ id }) => id)\\r\\n}\\r\\n\\r\\n\\/\\/ 字典数据\\r\\nconst dictData = reactive<Record<string, any[]>>({\\r\\n    \\r\\n})\\r\\n\\r\\n\\/\\/ 获取字典数据\\r\\nconst getDictData = () => {\\r\\n\\r\\n}\\r\\n\\r\\n\\/\\/ 分页相关\\r\\nconst { pager, getLists, resetParams, resetPage } = usePaging({\\r\\n    fetchFun: apiUsersLists,\\r\\n    params: queryParams\\r\\n})\\r\\n\\r\\n\\/\\/ 添加\\r\\nconst handleAdd = async () => {\\r\\n    showEdit.value = true\\r\\n    await nextTick()\\r\\n    editRef.value?.open(\'add\')\\r\\n}\\r\\n\\r\\n\\/\\/ 编辑\\r\\nconst handleEdit = async (data: any) => {\\r\\n    showEdit.value = true\\r\\n    await nextTick()\\r\\n    editRef.value?.open(\'edit\')\\r\\n    editRef.value?.setFormData(data)\\r\\n}\\r\\n\\r\\n\\/\\/ 删除\\r\\nconst handleDelete = async (id: number | any[]) => {\\r\\n    await feedback.confirm(\'确定要删除？\')\\r\\n    await apiUsersDelete({ id })\\r\\n    getLists()\\r\\n}\\r\\n\\r\\ngetLists()\\r\\ngetDictData()\\r\\n<\\/script>\\r\\n\\r\\n\"},{\"name\":\"edit.vue\",\"type\":\"vue\",\"content\":\"<template>\\r\\n    <div class=\\\"edit-popup\\\">\\r\\n        <popup\\r\\n            ref=\\\"popupRef\\\"\\r\\n            :title=\\\"popupTitle\\\"\\r\\n            :async=\\\"true\\\"\\r\\n            width=\\\"550px\\\"\\r\\n            :clickModalClose=\\\"true\\\"\\r\\n            @confirm=\\\"handleSubmit\\\"\\r\\n            @close=\\\"handleClose\\\"\\r\\n        >\\r\\n            <el-form ref=\\\"formRef\\\" :model=\\\"formData\\\" label-width=\\\"90px\\\" :rules=\\\"formRules\\\">\\r\\n                \\r\\n            <\\/el-form>\\r\\n        <\\/popup>\\r\\n    <\\/div>\\r\\n<\\/template>\\r\\n\\r\\n<script lang=\\\"ts\\\" setup>\\r\\nimport type { FormInstance } from \'element-plus\'\\r\\nimport Popup from \'@\\/components\\/popup\\/index.vue\'\\r\\nimport { dictDataLists } from \'@\\/api\\/setting\\/dict\'\\r\\nimport { apiUsersAdd, apiUsersEdit } from \'@\\/api\\/users\'\\r\\nimport { timeFormat } from \'@\\/utils\\/util\'\\r\\n\\r\\nconst emit = defineEmits([\'success\', \'close\'])\\r\\nconst formRef = shallowRef<FormInstance>()\\r\\nconst popupRef = shallowRef<InstanceType<typeof Popup>>()\\r\\nconst mode = ref(\'add\')\\r\\n\\r\\n\\/\\/ 弹窗标题\\r\\nconst popupTitle = computed(() => {\\r\\n    return mode.value == \'edit\' ? \'编辑用户表\' : \'新增用户表\'\\r\\n})\\r\\n\\r\\n\\/\\/ 表单数据\\r\\nconst formData = reactive({\\r\\n    id: \'\',\\r\\n    \\r\\n})\\r\\n\\r\\n\\/\\/ 字典数据\\r\\nconst dictData = reactive<Record<string, any[]>>({\\r\\n    \\r\\n})\\r\\n\\r\\n\\/\\/ 获取字典数据\\r\\nconst getDictData = () => {\\r\\n\\r\\n}\\r\\n\\r\\n\\/\\/ 表单验证\\r\\nconst formRules = reactive<any>({\\r\\n    amount1: [{\\r\\n        required: true,\\r\\n        message: \'请输入链上BNB快照\',\\r\\n        trigger: [\'blur\']\\r\\n    }],\\r\\n    amount2: [{\\r\\n        required: true,\\r\\n        message: \'请输入BNB分红\',\\r\\n        trigger: [\'blur\']\\r\\n    }],\\r\\n})\\r\\n\\r\\n\\r\\n\\/\\/ 获取详情\\r\\nconst setFormData = (data: Record<any, any>) => {\\r\\n    for (const key in formData) {\\r\\n        if (data[key] != null && data[key] != undefined) {\\r\\n            \\/\\/@ts-ignore\\r\\n            formData[key] = data[key]\\r\\n        }\\r\\n    }\\r\\n    \\r\\n    \\r\\n}\\r\\n\\r\\n\\r\\n\\/\\/ 提交按钮\\r\\nconst handleSubmit = async () => {\\r\\n    await formRef.value?.validate()\\r\\n    const data = { ...formData,  }\\r\\n    mode.value == \'edit\' \\r\\n        ? await apiUsersEdit(data) \\r\\n        : await apiUsersAdd(data)\\r\\n    popupRef.value?.close()\\r\\n    emit(\'success\')\\r\\n}\\r\\n\\r\\n\\/\\/打开弹窗\\r\\nconst open = (type = \'add\') => {\\r\\n    mode.value = type\\r\\n    popupRef.value?.open()\\r\\n}\\r\\n\\r\\n\\/\\/ 关闭回调\\r\\nconst handleClose = () => {\\r\\n    emit(\'close\')\\r\\n}\\r\\n\\r\\ngetDictData()\\r\\n\\r\\ndefineExpose({\\r\\n    open,\\r\\n    setFormData\\r\\n})\\r\\n<\\/script>\\r\\n\"},{\"name\":\"menu.sql\",\"type\":\"sql\",\"content\":\"INSERT INTO `ls_system_menu`(`pid`, `type`, `name`, `icon`, `sort`, `perms`, `paths`, `component`, `selected`, `params`, `is_cache`, `is_show`, `is_disable`, `create_time`, `update_time`)\\r\\n VALUES (0, \'C\', \'用户管理\', \'\', 1, \'users\\/lists\', \'users\', \'users\\/index\', \'\', \'\', 0, 1, 0, 1660184199, 1660184199);\\r\\n\\r\\nSELECT @pid := LAST_INSERT_ID();\\r\\n\\r\\nINSERT INTO `ls_system_menu`(`pid`, `type`, `name`, `icon`, `sort`, `perms`, `paths`, `component`, `selected`, `params`, `is_cache`, `is_show`, `is_disable`, `create_time`, `update_time`)\\r\\n VALUES (@pid, \'A\', \'添加\', \'\', 1, \'users\\/add\', \'\', \'\', \'\', \'\', 0, 1, 0, 1660184199, 1660184199);\\r\\n\\r\\nINSERT INTO `ls_system_menu`(`pid`, `type`, `name`, `icon`, `sort`, `perms`, `paths`, `component`, `selected`, `params`, `is_cache`, `is_show`, `is_disable`, `create_time`, `update_time`)\\r\\n VALUES (@pid, \'A\', \'编辑\', \'\', 1, \'users\\/edit\', \'\', \'\', \'\', \'\', 0, 1, 0, 1660184199, 1660184199);\\r\\n\\r\\nINSERT INTO `ls_system_menu`(`pid`, `type`, `name`, `icon`, `sort`, `perms`, `paths`, `component`, `selected`, `params`, `is_cache`, `is_show`, `is_disable`, `create_time`, `update_time`)\\r\\n VALUES (@pid, \'A\', \'删除\', \'\', 1, \'users\\/delete\', \'\', \'\', \'\', \'\', 0, 1, 0, 1660184199, 1660184199);\\r\\n\"}]}', '127.0.0.1', '1660184199');
